import { setWriteMode } from '../states/appMode'
import { playLowTone } from '../states/soundLibrary'

export const WriteButton = (props: { label?: string }) => (
  <button
    onClick={() => {
      playLowTone()
      setWriteMode()
    }}
  >
    {props.label || 'Write'}
  </button>
)
